import Nav from '../components/Nav';
import ChatBox from '../components/Chatbox';

import React from 'react'
import Sidebar from '../components/Sidebar';

const Main = () => {
  return (
    <div class="container">
      <div class='row'>

        <div class='col'>
          < Sidebar />
        </div>

        <div class='col'>
          <Nav />
          <ChatBox />
        </div>
        
      </div>
    </div>
  )
}

export default Main
